"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Endocarditis (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/endocarditis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H194951735\">",
"      <span class=\"h1\">",
"       What is endocarditis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Endocarditis is the term doctors use when a heart valve (or valves) gets inflamed or infected (",
"      <a class=\"graphic graphic_figure graphicRef58389 \" href=\"UTD.htm?35/42/36516\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Endocarditis can lead to serious problems, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Heart damage and heart problems &ndash; Damage of the heart valves can lead to a condition called &ldquo;heart failure.&rdquo; Heart failure is when the heart has trouble pumping blood around the body.",
"       </li>",
"       <li>",
"        Small growths that form on the heart valves &ndash; Pieces of these growths can break off and travel through the blood to different parts of the body. They can then get stuck in and block off small blood vessels. This can cause organ damage and symptoms.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H194951742\">",
"      <span class=\"h1\">",
"       What causes endocarditis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Endocarditis is usually caused by bacteria. It can happen when:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        People have an infection in another part of the body. The bacteria from that infection can travel through the blood to the heart.",
"       </li>",
"       <li>",
"        Bacteria enter the body through the skin or mouth, and then travel through the blood to the heart. This can happen during dental surgery, or if people have a catheter (a thin tube that goes into a vein) for a long time. It can also happen if people inject drugs into their vein.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Many people who get endocarditis already have a heart problem or have had heart valve surgery in the past.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H194951749\">",
"      <span class=\"h1\">",
"       What are the symptoms of endocarditis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Endocarditis usually causes a fever and chills.",
"     </p>",
"     <p>",
"      If the endocarditis has caused problems with the heart or other organs, people can have other symptoms, too. For example, people who have heart failure can have trouble breathing, and swelling in their feet or legs. People who have kidney damage (from pieces of a growth that have broken off and traveled to the kidneys) can have red or brown urine.",
"     </p>",
"     <p>",
"      If pieces of a growth travel to and block blood vessels in the brain, it can cause a stroke. A stroke is when part of the brain is damaged because it goes without blood for too long. Symptoms of a stroke can include trouble speaking, or weakness or numbness in 1 or both arms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H194951756\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. See your doctor or nurse if you have a fever that lasts for many days, especially if you have a heart condition. You should also tell your doctor or nurse if you have any of the other symptoms mentioned above.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H194951763\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will ask about your symptoms and do an exam. During the exam, he or she will listen for a heart murmur, which is an extra sound in your heartbeat. A heart murmur is sometimes a sign of endocarditis.",
"     </p>",
"     <p>",
"      Your doctor or nurse will also probably do:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests, including a test called a &ldquo;blood culture&rdquo;",
"       </li>",
"       <li>",
"        A chest X-ray",
"       </li>",
"       <li>",
"        An ECG (also called an &ldquo;electrocardiogram&rdquo; or &ldquo;EKG&rdquo;) &ndash; This test measures the electrical activity in your heart (",
"        <a class=\"graphic graphic_figure graphicRef53145 \" href=\"UTD.htm?6/63/7154\">",
"         figure 2",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        An echocardiogram (also called an &ldquo;echo&rdquo;) &ndash; This test uses sound waves to create a picture of your heart as it beats (",
"        <a class=\"graphic graphic_figure graphicRef77971 \" href=\"UTD.htm?33/35/34354\">",
"         figure 3",
"        </a>",
"        ).",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H194951770\">",
"      <span class=\"h1\">",
"       How is endocarditis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Endocarditis is usually treated in the hospital with antibiotic medicines. These medicines go into your vein through a tube called an &ldquo;IV.&rdquo;",
"     </p>",
"     <p>",
"      In most cases, the antibiotic medicines get rid of the infection. But if they don&rsquo;t, or if your endocarditis has caused serious heart valve problems, you might need surgery. Surgery for endocarditis usually involves replacing your diseased heart valve with a heart valve that works normally.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H194951777\">",
"      <span class=\"h1\">",
"       How can I prevent getting endocarditis again?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After people have had endocarditis, they usually need to take antibiotics before they go to the dentist or have certain procedures. Taking antibiotics beforehand can help prevent getting another infection. Ask your doctor or nurse if you need to take antibiotics before those times.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H194951850\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?35/42/36514?source=see_link\">",
