"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?24/13/24787?source=see_link\">",
"       Patient information: Echocardiogram (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?24/51/25395?source=see_link\">",
"       Patient information: ECG and stress test (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?17/12/17601?source=see_link\">",
"       Patient information: Heart failure (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?23/55/24435?source=see_link\">",
"       Patient information: Stroke (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?21/34/22050?source=see_link\">",
"       Patient information: Hemorrhagic stroke (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?11/23/11635?source=see_link\">",
"       Patient information: Prosthetic valves (The Basics)",
"      </a>",
"     </p>",
