var title_f25_48_26379="ASM criteria";
var content_f25_48_26379=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F70400&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F70400&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    American Society of Addiction Medicine adult patient placement criteria for treatment of substance-related disorders",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Patient is assessed in 6 dimensions:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Acute intoxication and/or withdrawal potential",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Biomedical conditions and complications",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Emotional, behavioral, or cognitive conditions and complications",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4. Readiness to change",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       5. Relapse, continued use, or continued problem potential",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       6. Recovery/living environment",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Based on assessment, patient is recommended for one of four levels of treatment:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       I. Outpatient",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       II. Intensive outpatient/partial hospitalization",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Provides more frequent services, including evenings or weekends",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       III. Residential/inpatient",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       May include medical monitoring, but not at level of acute care hospital",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       IV. Medically managed intensive inpatient",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Mee-Lee, D, Shulman, GD, Fishman, M, et al. ASAM Patient Placement Criteria for the Treatment of SUbstance-Related Disorders. 2nd edition revised. American Society of Addiction Medicine, Chevy Chase, MD 2001.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
