var title_f25_48_26382="LD history";
var content_f25_48_26382=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F76081&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F76081&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Important elements of the history for students with learning failure",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1_single\">",
"        Potential significance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        History of the learning problem",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        When did the family first notice learning problems in the child? Is the child learning successfully now, or still struggling?",
"       </td>",
"       <td>",
"        Persistent learning problems over time are more highly associated with LD than a learning problem or recent onset; LD can first manifest at any time throughout the primary and elementary school years, but usually manifests in the primary school years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        What helps the child learn more successfully? (eg, small group instruction; 1:1 instruction, etc)",
"       </td>",
"       <td>",
"        Greater success in small groups as opposed to the general classroom may be related to LD, or may be related to other factors such as a language disorder or weak executive skills",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        School performance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        What are the child's grades?",
"       </td>",
"       <td>",
"        Past or current poor academic achievement is a significant risk factor for LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Can the child complete homework independently?",
"       </td>",
"       <td>",
"        Inability to complete homework independently, especially after grade one, can indicate LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Did the child receive any early intervention or special education services?",
"       </td>",
"       <td>",
"        Past early intervention or special education services are a significant risk factor for LD, regardless of the type of service that was offered, and regardless of whether the child was found to be no longer eligible for services",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Did the child's teachers provide any indication that they were concerned about the child's educational progress?",
"       </td>",
"       <td>",
"        Not all teachers can identify LD specifically, and not all teachers have access to a student support team to facilitate identification of LD; however, teacher observations of learning failure is a sensitive indicator of LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Past grade retention",
"       </td>",
"       <td>",
"        Past grade retention is a significant risk factor for LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        School attendance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Does the child attend school regularly, now and in the past?",
"       </td>",
"       <td>",
"        Past school absences have a significant impact upon learning success, and can mimic LD or be due to LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Does the child have a history of school avoidance?",
"       </td>",
"       <td>",
"        School avoidance may be due to perceived lack of competence because of LD, and may also lead to school absences, aggravating learning problems",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Current psychiatric or behavioral conditions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        Mental health conditions often occur with LD and are a risk factor for LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ability to focus and sustain attention to complete tasks of the daily routine; participate in social activities; and/or complete homework independently",
"       </td>",
"       <td>",
"        Symptoms of inattention are associated with attention deficit hyperactivity disorder, which is highly comorbid with LD; LD can also cause inattention during academic tasks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Capacity to regulate anxiety, eg, separation anxiety when leaving the home to go to school or elsewhere; other symptoms of anxiety",
"       </td>",
"       <td>",
"        Symptoms of anxiety are a risk factor for LD, either as a comorbid condition or as a result of LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Capacity for managing frustration (waiting his/her turn in a game; capacity to self-soothe when angry)",
"       </td>",
"       <td>",
"        Symptoms of difficulty regulating anger is a risk factor for behavior disorders, which are highly comorbid with LD; low frustration tolerance for school activities specifically is a significant risk factor for LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Medical history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Prenatal health problems; prenatal exposure to medications, toxins (alcohol, nicotine, etc) or infection",
"       </td>",
"       <td>",
"        Past neurological insults are a risk factor for learning problems in general, and for LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Perinatal course and complications",
"       </td>",
"       <td>",
"        Perinatal complications are a risk factor for learning problems in general, and for LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Gestational age; birth weight",
"       </td>",
"       <td>",
"        Prematurity is a risk factor for learning problems in general, and for LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Past illnesses, especially affecting the CNS",
"       </td>",
"       <td>",
"        Past neurological insults are a risk factor for learning problems in general, and for LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Past lead exposure",
"       </td>",
"       <td>",
"        Lead exposure is associated with lower cognitive potential",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Past or current medications",
"       </td>",
"       <td>",
"        Medications may interfere with CNS functioning, and may be associated with learning failure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Current neurological symptoms to suggest seizures",
"       </td>",
"       <td>",
"        Seizures can interfere with learning",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Current sleeping habits",
"       </td>",
"       <td>",
"        Poor sleeping habits may interfere with learning success",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Developmental history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age-appropriate attainment of gross motor skills",
"       </td>",
"       <td>",
"        Motor problems are related to cerebral palsy and other neurological conditions, which are comorbid with learning failure in general, and may be associated with LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age-appropriate attainment of language skills",
"       </td>",
"       <td>",
"        Language problems are highly comorbid with LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age-appropriate attainment of adaptive skills such as personal care, toileting",
"       </td>",
"       <td>",
"        Age-appropriate attainment of adaptive skills requires general cognitive skills, as well as attention regulation skills; poor adaptive function may be associated with learning failure and with LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Attainment of social and play skills (ability to play successfully with same-age peers without parent supervision; capacity for friendships)",
"       </td>",
"       <td>",
"        Social skills may be delayed as a primary problem (eg, autism spectrum disorder), or may be due to perceived lack of self-confidence due to LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Able to participate in community activities such as sports teams or other recreational activities",
"       </td>",
"       <td>",
"        Motor, adaptive, and social skills are required for success in community activities; LD is associated with lower success in these areas",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Family history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Do any first- or second-degree relatives have learning problems?",
"       </td>",
"       <td>",
"        LD is often inherited",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Do any first- or second-degree relatives have mental health or developmental conditions such as anxiety, depression, attention problems, learning problems, etc?",
"       </td>",
"       <td>",
"        Mental health conditions often occur with LD and are a risk factor for LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        What are the parents' or family's current reading habits?",
"       </td>",
"       <td>",
"        The history of current reading habits can serve as a proxy for an unidentified reading disability",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        How far did the parents take their education?",
"       </td>",
"       <td>",
"        Poor educational achievement is related to LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Social history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Current parent employment status",
"       </td>",
"       <td>",
"        Current parental employment status may be related to the parents' success at school and maybe an indicator of LD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Past abuse or neglect",
"       </td>",
"       <td>",
"        Past abuse or neglect is a significant risk factor for poor educational achievement in general, and may be related to LD, regardless of current social status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Past or current homelessness",
"       </td>",
"       <td>",
"        Past homelessness is a significant risk factor for poor educational achievement in general, and may be related to LD, regardless of current living circumstances",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Past or current parental illnesses in family members",
"       </td>",
"       <td>",
"        Past illnesses in the family is a risk factor for poor educational achievement, for both social and heritable reasons",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Poor educational achievement may occur because of LD, weak language skills, weak executive skills, or lower overall cognitive potential. All of the risk factors listed above are associated with learning failure and strengthen the case for requesting an evaluation for LD or other causes of learning failure.",
"    <div class=\"footnotes\">",
"     LD: learning disability; CNS: central nervous system.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
